import Table from 'react-bootstrap/table'
import ProgressBar from 'react-bootstrap/ProgressBar';
import Iframe from 'react-iframe';
import Col from 'react-bootstrap/Col';
import Nav from 'react-bootstrap/Nav';
import Row from 'react-bootstrap/Row';
import Tab from 'react-bootstrap/Tab';
import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';
import { Alert } from 'react-bootstrap';
import Container from 'react-bootstrap/Container';
import { useState, useEffect } from 'react';
import { getValue } from '@testing-library/user-event/dist/utils';



function CompleteEnrolment() {

	const[checked,setChecked] = useState(false)

	const[progress,setProgress] = useState(JSON.parse(window.localStorage.getItem('progress')))


	useEffect(()=> {
		window.localStorage.setItem('progress', (progress))
	})


	function check() {
		setProgress(progress + 50);
		setChecked(true);
	};


	/*Cant setText twice????*/

	return(
	<div>


	<Container>
	<h1 style={{textAlign:'center', fontWeight:'800'}}> Complete Enrollment </h1>
	<ProgressBar animated now={progress} />
	<div style={{textAlign:'center', fontWeight:'600', border: '1px solid', width: '20%', margin: 'auto'}}>
	<h3>Status: {progress}%</h3>
	</div>
	</Container>


	<Container fluid="md">
		<Row>
			<Col lg={6} style={{textAlign: 'center', background: 'lightyellow', border: '2px solid', marginTop: '25px', marginBottom: '25px', boxShadow: '0px 0px 5px'}}>
				<h3>Email <em>segcesena@unibo.it</em> for Appointmnet</h3>
				<div style={{border: '5px solid', width:"80%", margin: 'auto'}}>
				<Iframe src="https://outlook.office.com/" width="100%" height="500px" style="border:1;" allowfullscreen="" loading="lazy" referrerpolicy="no-referrer-when-downgrade"></Iframe>
				</div>
			<Button onClick={check} disabled={checked}> Done </Button>
			</Col>
		</Row>
		<Row>
			<Col sm={12}>
				<h3>Arrive at Secretary Office</h3>
				<div style={{border: '5px solid', width:"80%", margin: 'auto'}}>
				<Iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2863.232528295218!2d12.242089415649941!3d44.14045002880405!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x132ca4cf4cf57c7f%3A0x99a6da8cbf2c81da!2sVia%20Montalti%2C%2079%2C%2047521%20Cesena%20FC%2C%20Italy!5e0!3m2!1sen!2sus!4v1674078434291!5m2!1sen!2sus/" width="100%" height="500px" style="border:1;" allowfullscreen="" loading="lazy" referrerpolicy="no-referrer-when-downgrade"></Iframe>
				</div>
			<Button onClick={check} disabled={checked}> Done </Button>
			</Col>
		</Row>
	</Container>



	<Card>
      <Card.Header>Getting There</Card.Header>
      <Card.Body>
        <Card.Title>Via Montalti, 79</Card.Title>
		<Iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2863.232528295218!2d12.242089415649941!3d44.14045002880405!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x132ca4cf4cf57c7f%3A0x99a6da8cbf2c81da!2sVia%20Montalti%2C%2079%2C%2047521%20Cesena%20FC%2C%20Italy!5e0!3m2!1sen!2sus!4v1674078434291!5m2!1sen!2sus" width="100%" height="100%" style="border:1;" allowfullscreen="" loading="lazy" referrerpolicy="no-referrer-when-downgrade"></Iframe>
        <Card.Text>
        </Card.Text>
        <Button variant="primary">Go somewhere</Button>
      </Card.Body>
    </Card>

	<Alert style={{fontStyle:'italic'}} variant='danger'><p>They take appointments by mail, so make sture to write to them to schedule an appointment in person before your arrival!</p></Alert>

	</div>
	)
}

export default CompleteEnrolment
